                    "creditsColumnTitle": "About",
                    "creditsColumnText": "We were born out of cultural collaboration, forging Music, Cre&tivity, and our passionate hearts\nfor the planet. A spark of light to find our way, find our way through the dark.\nVulnerably expressing, riding along the soul train, igniting feelings we haven't felt.\nInspired by and inspiring curiosity through imagination. Yearning for a deeper, more meaningful\nconnection with each other, ourselves, and Mama Earth.\nMusic is endless; it is timeless; it runs broader and deeper than anyone might imagine. It is\ninfinite and seemingly inexhaustible in its capacity to inspire, excite, and provoke creative insight\nand self-love.\nWe live our lives out in the open, committed to truth-telling.\nWhat we cannot imagine cannot come into being.\nThis space is A culmination of 'work' that enhances our spiritual well-being and strengthens our\ncapacity to love.\nIt is an environment shaped by an ethic of love.\nThe light of love is always in us, no matter how cold the flame is. It is always present, waiting for \nthe spark to ignite, waiting for the heart to awaken and call us back to the first memory of being\nthe life force inside a dark place waiting to be born - waiting to see the light.\nWhat we cannot imagine cannot come into being; follow the signs and see where the heart\ntakes you.\nWelcome to &friends..",
